import React from 'react'
import Part from './Part'

const Content = ( {parts} ) => {

    return (
        <div>
            <ul>     
            {parts.map(
                // part => console.log(part.name)
                part => <Part key={part.id} part={part} />
                )
            }
            </ul>

            {parts.reduce((s,p) => {
                 s + p.exercises
                })
            }

        </div>
    )
  }

export default Content
